import React from "react";

class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = { date: new Date() };
  }
  render() {
    return (
      <div>
        <input type="text" />
        <button className="button">확 인</button>
      </div>
    );
  }
}
export default Home;
